window.bookSummaryJSON = "<p>From the <i>New York Times</i> and internationally best-selling authors of the Illuminae Files comes a new science fiction epic....</p> <p>The year is 2380, and the graduating cadets of Aurora Academy are being assigned their first missions. Star pupil Tyler Jones is ready to recruit the squad of his dreams, but his own boneheaded heroism sees him stuck with the dregs nobody else in the academy would touch....</p> <p>A cocky diplomat with a black belt in sarcasm</p> <p>A sociopath scientist with a fondness for shooting her bunkmates&nbsp;</p> <p>A smart-ass tech whiz with the galaxy's biggest chip on his shoulder</p> <p>An alien warrior with anger-management issues</p> <p>A tomboy pilot who's totally not into him, in case you were wondering</p> <p>And Ty's squad isn't even his biggest problem - that'd be Aurora Jie-Lin O'Malley, the girl he's just rescued from interdimensional space.</p> <p>Trapped in cryo-sleep for two centuries, Auri is a girl out of time and out of her depth. But she could be the catalyst that starts a war millions of years in the making, and Tyler's squad of losers, discipline cases, and misfits might just be the last hope for the entire galaxy.</p> <p>NOBODY PANIC.</p> <p>Audiobook Cast of Narrators:<br> Aurora, read by Kim Mai Guest <br> Tyler, read by Johnathan McClain <br> Cat, read by Candice Moll <br> Fin, read by Lincoln Hoppe <br> Zila, read by Donnabella Mortel <br> Magellan, read by Jonathan Todd Ross <br> Scarlett, read by Erin Spencer <br> Kal, read by Steve West&nbsp;</p>"; 
